export default function getOpenTransactionBalance(transactions, transaction) {
  return (
    transaction.amount -
    transactions
      .filter(t => {
        console.log(t.frm[transaction.sig]);
        return t.frm[transaction.sig];
      })
      .map(t => t.amount)
      .reduce((total, x) => x + total, 0)
  );
}
